import React, { Component } from "react";
import { RiDeleteBinFill } from 'react-icons/ri';

class TodoItems extends Component {
    constructor(props) {
        super(props);

        this.createTasks = this.createTasks.bind(this);
    }

    delete(key) {
        this.props.delete(key);
    }

    createTasks(item) {
        return (
                <div style={{flexDirection: 'row',  backgroundColor: '#987', justifyContent:  'space-between', alignItems: 'center'}}>
                    <text style={{width: 200, backgroundColor: '#123'}}>{item.text}</text>
                    <RiDeleteBinFill style={{ backgroundColor: '#65478'}} onClick={() => this.delete(item.key)} key={item.key}/>
                </div>
        )
    }

    render() {
        const todoEntries = this.props.entries;
        const listItems = todoEntries.map(this.createTasks);

        return (
            <ol className="theList">
                {listItems}
            </ol>
        );
    }
}

export default TodoItems;
